import React, { Component } from 'react';


class Table extends Component {

    constructor(){
        super();
    }

    render() {
        return (
            <div>
                <table className="table">
                    <thead>
                        <tr>
                            <th className="text-center" scope="col">#</th>
                            <th className="text-center" scope="col">Tareas pendientes</th>
                            <th className="text-center" scope="col">Fecha</th>
                            <th className="text-center" scope="col">Hora</th>
                            <th className="text-center" scope="col">Completar</th>
                            <th className="text-center" scope="col">Eliminar</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <th scope="row">2</th>
                            <td className="text-center">Jacob</td>
                            <td className="text-center">Thornton</td>
                            <td className="text-center">@fat</td>
                            <td className="text-center"> <input type="checkbox" name="" id="" /> </td>
                            <td className="text-center"><button className="btn btn-danger">Eliminar</button></td>
                        </tr>
                    </tbody>
                </table>
            </div>
        );
    }
}

export default Table;
